import React,{Component} from 'react';


import {
    CButton,
    CCard,
    CCardBody,
    CCardHeader,
    CCol,
    CInput,
    CLabel,
    CForm,
    CFormGroup,
    CRow
  } from '@coreui/react'
  import CIcon from '@coreui/icons-react'
  import ReactSummernote from 'react-summernote';
  import 'react-summernote/dist/react-summernote.css'; 
  import 'react-summernote/lang/summernote-ru-RU';
  import 'bootstrap/dist/css/bootstrap.css';
  import $ from 'jquery';
  window.jQuery = $;

  class AddVacancy extends Component {

    constructor(props) {
      super(props);
      this.saveNewVacancy = this.saveNewVacancy.bind(this);
    }
    saveNewVacancy=(e)=>{
    e.preventDefault();
    console.log(this.editor);
    }
    onChange=(content)=>{
    console.log('onchange',content);
    }


    render() { 
      // const [collapsed, setCollapsed] = React.useState(true)
        return (
            <CRow>
            <CCol xs="12">
            <CCard>
            <CCardHeader>
              Company
              <small> Form</small>
            </CCardHeader>
            <CCardBody>
              <CForm onSubmit={this.saveNewVacancy}>
              <CFormGroup>
                <CLabel htmlFor="company">Company</CLabel>
                <CInput id="company" placeholder="Enter your company name" />
              </CFormGroup>
              <CFormGroup>
                <CLabel htmlFor="vat">VAT</CLabel>
                <CInput id="vat" placeholder="DE1234567890" />
              </CFormGroup>
              <CFormGroup>
                <CLabel htmlFor="street">Street</CLabel>
                <CInput id="street" placeholder="Enter street name" />
              </CFormGroup>
              <CFormGroup row className="my-0">
                <CCol xs="8">
                  <CFormGroup>
                    <CLabel htmlFor="city">City</CLabel>
                    <CInput id="city" placeholder="Enter your city" />
                  </CFormGroup>
                </CCol>
                <CCol xs="4">
                  <CFormGroup>
                    <CLabel htmlFor="postal-code">Postal Code</CLabel>
                    <CInput id="postal-code" placeholder="Postal Code" />
                  </CFormGroup>
                </CCol>
              </CFormGroup>
              <CFormGroup>
                <CLabel htmlFor="country">Country</CLabel>
                <CInput id="country" placeholder="Country name" required/>
              </CFormGroup>
              <CFormGroup>
                <CLabel htmlFor="country">Country</CLabel>
                <ReactSummernote
        value="Default value"
        onChange={this.onChange}
      />

              </CFormGroup>
              <CButton type="submit" size="sm" color="info"><CIcon name="cil-scrubber" /> Submit</CButton> <CButton type="reset" size="sm" color="danger"><CIcon name="cil-ban" /> Reset</CButton>
            </CForm>
            </CCardBody>
          </CCard>
            </CCol>
          </CRow>
        );
    }
}

export default AddVacancy;
